import React, { useEffect, useState } from "react";
import axios from "axios";

function App() {
  const [columns, setColumns] = useState([]);
  const [exportMessage, setExportMessage] = useState("");
  const [email, setEmail] = useState("");
  const [phone, setPhone] = useState("");

  useEffect(() => {
    axios.get("http://localhost:8800/users/columns").then((response) => {
      setColumns(response.data);
    });
  }, []);

  const handleExport = () => {
    const sourceDefinition = "some source definition";
    axios
      .post("http://localhost:8800/users/export", { sourceDefinition })
      .then((response) => {
        setExportMessage(response.data);
      });
  };

  const handleUpdate = (id) => {
    axios
      .put(`http://localhost:8800/users/${id}`, { email, phone })
      .then((response) => {
        console.log(response.data);
      });
  };

  return (
    <div>
      <h2>User Table Columns</h2>
      <ul>
        {columns.map((column) => (
          <li key={column.column_name}>
            {column.column_name} ({column.data_type})
          </li>
        ))}
      </ul>
      <button onClick={handleExport}>Export to File</button>
      <p>{exportMessage}</p>
      <h2>Update User Information</h2>
      <div>
        <form>
          <label htmlFor="email">Email:</label>
          <input
            type="text"
            id="email"
            name="email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
          />
          <br />
          <label htmlFor="phone">Phone:</label>
          <input
            type="text"
            id="phone"
            name="phone"
            value={phone}
            onChange={(e) => setPhone(e.target.value)}
          />
          <br />
          <button type="button" onClick={() => handleUpdate(1)}>
            Update
          </button>
        </form>
      </div>
    </div>
  );
}

export default App;
